import React from "react";
import { Link } from "react-router-dom";

const RentalItem = ({ rental }) => {
  const { id, country, title, price, shared, category } = rental;
  return (
    <Link to={"/rentals/" + id} className="RentalItem">
      <div className="card" style={{ width: "18rem" }}>
        <img className="card-img-top" src="/images/header.jpg" alt="" />
        <div className="card-body">
          <h5 className={`card-title ${category}`}>
            {/* {shared ? "shared" : "whole"} {category} &#183; {city} */}{" "}
            {country}
          </h5>
          <h6 className="card-subtitle ">{title}</h6>
          <p className="card-text">
            <strong>${price} USD</strong> / night
          </p>

          {/* <p className="card-text">{city}</p>
          <p className="card-text">{title}</p>
          <p className="card-text">{price}/night</p> */}
        </div>
      </div>
    </Link>
  );
};

export default RentalItem;
